import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "../../styles/WhyRGM.css";

/* HERO SLIDESHOW IMAGES */
import g10 from "../../assets/gallery/images/gallery10.jpg";
import g11 from "../../assets/gallery/images/gallery11.jpg";
import g12 from "../../assets/gallery/images/gallery12.jpg";
import g13 from "../../assets/gallery/images/gallery13.jpg";
import g14 from "../../assets/gallery/images/gallery14.jpg";
import g15 from "../../assets/gallery/images/gallery15.jpg";
import g16 from "../../assets/gallery/images/gallery16.jpg";
import g17 from "../../assets/gallery/images/gallery17.jpg";
import g18 from "../../assets/gallery/images/gallery18.jpg";
import g19 from "../../assets/gallery/images/gallery19.jpg";
import g20 from "../../assets/gallery/images/gallery20.jpg";
import g21 from "../../assets/gallery/images/gallery21.jpg";
import g22 from "../../assets/gallery/images/gallery22.jpg";
import g23 from "../../assets/gallery/images/gallery23.jpg";
import g24 from "../../assets/gallery/images/gallery24.jpg";
import g25 from "../../assets/gallery/images/gallery25.jpg";

const images = [
  g10,g11,g12,g13,g14,g15,g16,g17,
  g18,g19,g20,g21,g22,g23,g24,g25
];

function WhyRGM() {
  const [current, setCurrent] = useState(0);

  useEffect(() => {
    const timer = setInterval(() => {
      setCurrent(prev => (prev + 1) % images.length);
    }, 4500);
    return () => clearInterval(timer);
  }, []);

  return (
    <div className="why-rgm-page">

      {/* HERO */}
      <section
        className="why-hero"
        style={{ backgroundImage: `url(${images[current]})` }}
      >
        <div className="hero-overlay">
          <h1 className="hero-title">Why RGM Family</h1>
          <p>
            At RGM, youâ€™re not just joining a company â€”
            youâ€™re becoming part of a family that grows together.
          </p>

          <Link to="/joinRGM/ApplyToday">
            <button className="apply-btn">Apply Now</button>
          </Link>
        </div>
      </section>

      {/* INTRO */}
      <section className="why-intro">
        <p>
          RGM may be a young company, but our foundation is built on something
          timeless: <strong>trust, respect, and people-first values</strong>.
          We believe success comes from taking care of our drivers, employees,
          and partners like family â€” because when they succeed, we succeed.
        </p>
      </section>

      {/* IMAGE SHOWCASE */}
      <section className="image-showcase">
        {images.slice(0, 8).map((img, i) => (
          <div key={i} className="showcase-card">
            <img src={img} alt="RGM Fleet" />
          </div>
        ))}
      </section>

      {/* VALUES */}
      <section className="why-values">
        {[
          ["ðŸ¤ Family First Culture", "We treat everyone with respect and fairness. Your voice matters."],
          ["ðŸ›¡ Integrity & Trust", "Honesty and transparency guide everything we do."],
          ["ðŸš› Driver-Focused Mindset", "Drivers are the backbone of RGM."],
          ["ðŸ“ˆ Growth Together", "As RGM grows, our people grow with us."],
          ["ðŸ§  Smart Technology", "Modern tools without losing the human touch."],
          ["ðŸ’™ Support Beyond Work", "We care about your well-being on and off the job."]
        ].map((item, i) => (
          <div className="value-card" key={i}>
            <h3>{item[0]}</h3>
            <p>{item[1]}</p>
          </div>
        ))}
      </section>

      {/* FAMILY MESSAGE */}
      <section className="family-message">
        <h2>This Is More Than a Job</h2>
        <p>
          When you join RGM, youâ€™re joining a team that looks out for one another,
          celebrates wins together, and stands together through challenges.
        </p>
      </section>

      {/* CTA */}
      <section className="why-cta">
        <h2>Letâ€™s Talk About Your Future With RGM</h2>
        <Link to="/joinRGM/ApplyToday">
          <button className="apply-btn">Apply Now</button>
        </Link>
      </section>

    </div>
  );
}

export default WhyRGM;
